import React, { useState } from 'react'
import TextField from '@mui/material/TextField';
import { Box } from '@mui/material';


import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';

export default function SignUp() {
    const [requestResult,setRequestResult] = useState('');
    const SignUpHandler = () =>{
        const data = {
            "id":"ksm",
            "userEmail":"kdy0324n@naver.com",
            "userPassword":"12341234",
            "userName":"김성민",
            "userNickName":"ksm",
            "userPicture":"asdfasdfasdfasdf",
            "userBirth":"2023-11-11",
            "Timestamp":"2023-11-11-02:12:12",
            "userType":1
        }
        axios.post('http://localhost:8080/api/auth/signUp',data)
        .then((response)=>{
            setRequestResult('success!');
        })
        .catch((error)=>{
            setRequestResult('failed!');
        })
    }

  return (
    <Card sx={{ minWidth: 275,maxWidth:"50vw" }}>
        <CardContent>
        <Box>
        <TextField fullWidth id="standard-basic" label="Standard" variant="standard" />
