        <TextField fullWidth id="standard-basic" label="Standard" variant="standard" />
        <TextField fullWidth id="standard-basic" label="Standard" variant="standard" />
        <TextField fullWidth id="standard-basic" label="Standard" variant="standard" />
        <TextField fullWidth id="standard-basic" label="Standard" variant="standard" />
        <h3>{requestResult}</h3>
        </Box>
        </CardContent>
        <CardActions>
        <button onClick={() => SignUpHandler()}>회원가입</button>
        </CardActions>
    </Card>
    
  )
}
